import React from 'react';
import './Division.css';


const Division = (props)=>{
    return(    
      <div className="largeDiv">
      <h1 style="text-align:center;">{props.name}</h1>
      <h2>{props.title}</h2>
      <h3>{props.content}</h3>
        </div>);

  }

  export default Division;
